import React from 'react';
import { Box} from '@material-ui/core';
import green from "@material-ui/core/colors/green";
import {  Link } from "react-router-dom";

const AuthHeader = () => {
    return (
        <Box  position="absolute" top="0" height={100} width={"100%"}  bgcolor={green[100]}  display="flex" alignItems="center">
        <Box ml={23} >
            <Link to="/">
                <img src="/morimage.png" alt=""/>
            </Link>
        </Box>
      </Box>
    );
};

export default AuthHeader;
